(1, 'Aspirin Protect 100mg 30 tablets', 'اسبرين بروتيكت 100 مجم 30 قرص', 'General', 'عام', '- Medical description: The medication is an anti-inflammatory used in the treatment of acute coronary syndrome, prevention of cardiovascular diseases, and in the prevention of preeclampsia.\r\n\r\n- Indications and usage: It is used for the prevention of arterial thrombosis and strokes, in the treatment of unstable angina and acute myocardial infarction, and for the prevention of blood clotting after vascular surgery.\r\n\r\n- Dosage and administration: The dosage is determined according to the patient\'s needs and the type of condition, ranging from 100 mg to 300 mg daily for the prevention of blood clotting. The doctor decides the dosage and duration of use.\r\n\r\n- Side effects: Common side effects include stomach problems, asthma, digestive system issues, nausea, and vomiting, with the possibility of hypersensitivity reactions and gastrointestinal bleeding.\r\n\r\n- Warnings and precautions: Its use should be avoided in patients who are allergic to aspirin or have a history of peptic ulcer disease, and a doctor should be consulted before using it for children and teenagers.\r\n\r\n- Safety tips: It is important to adhere to the prescribed dosage and report any side effects to the doctor, and avoid its use in patients with asthma or children with chickenpox infection.', '- الوصف الطبي: الدواء هو مضاد التهاب يستخدم في علاج متلازمة الشريان التاجي الحادة، والوقاية من أمراض القلب والأوعية الدموية، وفي الوقاية من تسمم الحمل.\r\n\r\n- الدلالة والاستخدام: يستخدم للوقاية من الجلطات الشريانية والسكتات الدماغية، وفي علاج الذبحة الصدرية غير المستقرة واحتشاء عضلة القلب الحاد، وفي الوقاية من تجلط الدم بعد عمليات جراحية للأوعية الدموية.\r\n\r\n- الجرعة وطريقة الاستعمال: يتم تحديد الجرعة وفقًا لاحتياجات المريض ونوع الحالة، وتتراوح بين 100 ملغ إلى 300 ملغ يوميًا للوقاية من تجلط الدم. يقرر الطبيب الجرعة ومدة الاستخدام. \r\n\r\n- الآثار الجانبية: من بين الآثار الجانبية الشائعة مشاكل المعدة، والربو، ومشاكل الجهاز الهضمي، والغثيان، والقيء، مع إمكانية حدوث تفاعلات فرط الحساسية ونزيف معدي معوي.\r\n\r\n- التحذيرات والاحتياطات: يجب تجنب استخدامه لدى المرضى الذين يعانون من حساسية للأسبرين أو لديهم تاريخ مرض القرحة الهضمية، وينبغي استشارة الطبيب قبل استخدامه للأطفال والمراهقين.\r\n\r\n- نصائح الحذر: يجب الالتزام بالجرعة المحددة والتبليغ عن أي آثار جانبية للطبيب، وتجنب استخدامه لدى مرضى الربو أو الأطفال المصابين بعدوى الحماق.', 48.00, -5, 3, 'aspirin.jpg', NULL, '2024-12-06 14:24:17'),
(3, 'Brufen Cold 20 Film Coated Tablet', 'بروفين كولد 20 قرص مغلف', 'General', 'عام', '- Medical Description: Proven Cold Tablets are used to alleviate symptoms of the common cold and flu, as well as nasal congestion, including pain, headache, fever, sore throat, and nasal congestion, and sinusitis. They contain 400 mg of ibuprofen and 60 mg of pseudoephedrine.\n\n- Composition: Each tablet contains 400 mg of ibuprofen and 60 mg of pseudoephedrine.\n\n- Usage: Proven Cold Tablets are indicated for relieving symptoms associated with the common cold and flu, as well as nasal congestion, sore throat, and sinusitis.\n\n- Dosage: For adults and children over 12 years old: take 1 tablet up to 3 times daily. Allow at least 4 hours between doses. Do not exceed 3 doses within 24 hours.\n\n- Precautions: Consult your doctor if symptoms worsen or persist for more than 10 days. Do not use for prolonged periods. Not recommended for children under 12 years old.', '- الوصف الطبي: تستخدم أقراص البرد المثبتة للتخفيف من أعراض نزلات البرد والأنفلونزا، وكذلك احتقان الأنف، بما في ذلك الألم، والصداع، والحمى، والتهاب الحلق، واحتقان الأنف، والتهاب الجيوب الأنفية. أنها تحتوي على 400 ملغ من الإيبوبروفين و 60 ملغ من السودوإيفيدرين.\n\n- التركيب: يحتوي كل قرص على 400 ملجم ايبوبروفين و 60 ملجم سودوإيفيدرين.\n\n- الاستخدام: يشار إلى الأقراص الباردة لتخفيف الأعراض المرتبطة بنزلات البرد والأنفلونزا، وكذلك احتقان الأنف والتهاب الحلق والتهاب الجيوب الأنفية.\n\n- الجرعة: للبالغين والأطفال فوق 12 عامًا: تناول قرصًا واحدًا حتى 3 مرات يوميًا. اترك ما لا يقل عن 4 ساعات بين الجرعات. لا تتجاوز 3 جرعات خلال 24 ساعة.\n\n- الاحتياطات: استشر طبيبك إذا تفاقمت الأعراض أو استمرت لأكثر من 10 أيام. لا تستخدم لفترات طويلة. لا ينصح به للأطفال دون سن 12 عامًا.', 37.00, -230, NULL, 'brufenCold.jpg', '2024-05-06 19:29:06', '2024-12-06 14:43:37'),
(4, 'Celebrex 200mg 15 Capsules', 'سليبريكس 200 مجم 15 كبسولة', 'General', 'عام', '- Medical Description: Celebrex 200mg capsules belong to the class of nonsteroidal anti-inflammatory drugs (NSAIDs) and are primarily used to alleviate pain and inflammation.\n\n- Composition: Each capsule contains 200mg of Celecoxib.\n\n- Usage: Celebrex is utilized as an analgesic and anti-inflammatory agent in various conditions such as arthritis, ankylosing spondylitis, and menstrual pain.\n\n- Dosage: The typical adult dosage for pain is 400 mg initially, followed by 200 mg if necessary on the first day. Subsequently, take 200 mg twice daily as needed. If unable to swallow the capsule whole, it can be opened and the medicine sprinkled into food.\n\n- Precautions: Patients with cardiovascular disease or those at risk should seek advice from their physician before using Celebrex.', '- الوصف الطبي: تنتمي كبسولات سيليبريكس 200 ملغ إلى فئة مضادات الالتهاب غير الستيرويدية (NSAIDs) وتستخدم في المقام الأول لتخفيف الألم والالتهابات.\n\n- التركيب: تحتوي كل كبسولة على 200 ملغ من سيليكوكسيب.\n\n- الاستخدام: يستخدم سيليبريكس كمسكن ومضاد للالتهابات في حالات مختلفة مثل التهاب المفاصل والتهاب الفقار المقسط وآلام الدورة الشهرية.\n\n- الجرعة: الجرعة النموذجية للبالغين لعلاج الألم هي 400 ملغ في البداية، تليها 200 ملغ إذا لزم الأمر في اليوم الأول. وبعد ذلك، تناول 200 ملغ مرتين يوميًا حسب الحاجة. إذا لم تتمكن من بلع الكبسولة كاملة، يمكن فتحها ورش الدواء في الطعام.\n\n- الاحتياطات: يجب على المرضى الذين يعانون من أمراض القلب والأوعية الدموية أو المعرضين للخطر طلب المشورة من طبيبهم قبل استخدام سيليبريكس.', 153.00, -2, NULL, 'celebrex.jpg', '2024-05-06 19:29:06', '2025-05-15 03:16:53'),
(5, 'Recoxibright 90mg 30 Coated Tablets', 'ريكوكسيبرايت 90 مجم 30 \nقرص مغلف', 'General', 'عام', '- Medical Description: These tablets are anti-inflammatory and pain-relieving medications containing 90 mg of Etoricoxib. They work by reducing pain and inflammation in the joints and muscles, commonly associated with conditions such as osteoarthritis, rheumatoid arthritis, ankylosing spondylitis, and gout. Additionally, they are utilized for short-term treatment of moderate pain following dental surgery.\n\n- Composition: Each tablet contains 90 mg of Etoricoxib.\n\n- Usage: These tablets are indicated for reducing pain and inflammation in various musculoskeletal conditions such as osteoarthritis, rheumatoid arthritis, ankylosing spondylitis, and gout. They are also suitable for short-term treatment of moderate pain after dental surgery.\n\n- Dosage: The recommended dosage is once daily or as advised by the physician.\n\n- Precautions: Patients should adhere to the prescribed dosage and consult their physician for any concerns or adjustments. It\'s important to follow medical advice regarding the use of these tablets, especially in cases of prolonged usage or underlying health conditions.', '- الوصف الطبي: هذه الأقراص هي أدوية مضادة للالتهابات ومسكنة للآلام تحتوي على 90 ملغ من إيتوريكوكسيب. وهي تعمل عن طريق تقليل الألم والالتهابات في المفاصل والعضلات، والتي ترتبط عادةً بحالات مثل هشاشة العظام والتهاب المفاصل الروماتويدي والتهاب الفقار المقسط والنقرس. بالإضافة إلى ذلك، يتم استخدامها لعلاج قصير الأمد للألم المعتدل بعد جراحة الأسنان.\n\n- التركيب: يحتوي كل قرص على 90 ملغ من إيتوريكوكسيب.\n\n- الاستخدام: يشار إلى هذه الأقراص لتقليل الألم والالتهابات في حالات العضلات والعظام المختلفة مثل هشاشة العظام والتهاب المفاصل الروماتويدي والتهاب الفقار المقسط والنقرس. كما أنها مناسبة للعلاج قصير الأمد للألم المعتدل بعد جراحة الأسنان.\n\n- الجرعة: الجرعة الموصى بها هي مرة واحدة يومياً أو حسب إرشادات الطبيب.\n\n- الاحتياطات: يجب على المرضى الالتزام بالجرعة الموصوفة واستشارة الطبيب في حالة وجود أي مخاوف أو تعديلات. من المهم اتباع النصائح الطبية فيما يتعلق باستخدام هذه الأقراص، خاصة في حالات الاستخدام لفترة طويلة أو الحالات الصحية الأساسية.', 204.00, 17, NULL, 'recoxibright.jpg', '2024-05-06 19:29:06', '2025-05-13 14:26:49'),
(6, 'Doliprane (Novaldo) 1000mg 15 Tablet', 'دوليبران ١٥ قرص', 'General', 'عام', '- Medical Description: The active ingredient in this medication is Paracetamol, which is used for pain management and fever reduction.\n\n- Composition: Each dose contains Paracetamol.\n\n- Usage: It is used for the management of mild to moderate pain in patients aged 2 years and older, and for the management of moderate to severe pain when combined with opioid analgesia in patients aged 2 years and older. It is also utilized orally or rectally for the temporary relief of minor aches, pains, and headaches. Additionally, it is used to temporarily reduce fever.\n\n- Dosage: Dosage varies depending on the severity of pain and the age of the patient. Consult with a healthcare professional for appropriate dosing instructions.\n\n- Precautions: Patients should follow dosing instructions carefully and avoid exceeding the recommended dosage to prevent potential adverse effects. Consult a healthcare provider for advice on appropriate usage, especially in pediatric patients and those with underlying medical conditions.', '- الوصف الطبي: المادة الفعالة في هذا الدواء هي الباراسيتامول الذي يستخدم لتسكين الألم وخفض الحمى.\n\n- التركيب: كل جرعة تحتوي على باراسيتامول.\n\n- الاستخدام: يتم استخدامه لإدارة الألم الخفيف إلى المتوسط لدى المرضى الذين تتراوح أعمارهم بين عامين وما فوق، ولإدارة الألم المعتدل إلى الشديد عند دمجه مع المسكنات الأفيونية لدى المرضى الذين تتراوح أعمارهم بين عامين وما فوق. كما يتم استخدامه عن طريق الفم أو المستقيم للتخفيف المؤقت من الآلام البسيطة والآلام والصداع. بالإضافة إلى ذلك، يتم استخدامه لخفض الحمى بشكل مؤقت.\n\n- الجرعة: تختلف الجرعة حسب شدة الألم وعمر المريض. استشر أخصائي الرعاية الصحية للحصول على تعليمات الجرعات المناسبة.\n\n- الاحتياطات: يجب على المرضى اتباع تعليمات الجرعات بعناية وتجنب تجاوز الجرعة الموصى بها لمنع الآثار الضارة المحتملة. استشر مقدم الرعاية الصحية للحصول على المشورة بشأن الاستخدام المناسب، خاصة عند مرضى الأطفال والذين يعانون من حالات طبية كامنة.', 28.50, 96, NULL, 'doliprane.jpg', '2024-05-06 19:29:06', '2024-12-07 23:59:06'),
(7, 'Burfen 600mg 30 Tablets', 'بروفين 600 مجم 30 قرص', 'General', 'عام', '- Medical Description: Brufen 600mg tablets are utilized for pain and fever relief.\n\n- Composition: Each tablet contains Ibuprofen 600mg as the active ingredient.\n\n- Usage: They are indicated for the relief of various conditions including headache, fever, period pain, toothache, colds, and mild arthritis.\n\n- Dosage: The recommended dosage is 1200-1800 mg (2-3 tablets) daily, divided into multiple doses, or as prescribed by a physician.\n\n- Precautions: Patients should adhere to the prescribed dosage and consult their physician for any concerns or adjustments. It\'s important to follow medical advice regarding the use of these tablets, especially in cases of prolonged usage or underlying health conditions.', '- الوصف الطبي: تستخدم أقراص بروفين 600 ملغ لتسكين الألم والحمى.\n\n- التركيب: يحتوي كل قرص على إيبوبروفين 600 ملغ كمادة فعالة.\n\n- الاستخدام: يشار إليها لتخفيف الحالات المختلفة بما في ذلك الصداع والحمى وآلام الدورة الشهرية وألم الأسنان ونزلات البرد والتهاب المفاصل الخفيف.\n\n- الجرعة: الجرعة الموصى بها هي 1200-1800 ملغ (2-3 أقراص) يومياً، مقسمة على جرعات متعددة، أو حسب إرشادات الطبيب.\n\n- الاحتياطات: يجب على المرضى الالتزام بالجرعة الموصوفة واستشارة الطبيب في حالة وجود أي مخاوف أو تعديلات. من المهم اتباع النصائح الطبية فيما يتعلق باستخدام هذه الأقراص، خاصة في حالات الاستخدام لفترة طويلة أو الحالات الصحية الأساسية.', 66.00, 5, NULL, 'burfen.jpg', '2024-05-06 19:29:06', '2025-05-13 14:26:49'),
(8, 'Zyrtec 10mg 20 Tablets', 'زيرتيك 10 مجم 20 قرص', 'General', 'عام', '- Medical Description: These tablets are used for the management of allergic conditions.\n\n- Composition: Each tablet contains 10 mg of Cetirizine.\n\n- Usage: They act as an antihistamine to treat cold or allergy symptoms including sneezing, itching, watery eyes, and runny nose. Additionally, they relieve symptoms associated with seasonal allergic rhinitis and chronic urticaria.\n\n- Dosage: The recommended dosage is one tablet orally once a day or as directed by a physician.\n\n- Precautions: Patients should adhere to the prescribed dosage and consult their physician for any concerns or adjustments. It\'s important to follow medical advice regarding the use of these tablets, especially in cases of prolonged usage or underlying health conditions.', '- الوصف الطبي: تستخدم هذه الأقراص لعلاج حالات الحساسية.\n\n- التركيب: يحتوي كل قرص على 10 ملغ من السيتريزين.\n\n- الاستخدام: تعمل كمضاد للهستامين لعلاج أعراض البرد أو الحساسية بما في ذلك العطس والحكة والعيون الدامعة وسيلان الأنف. بالإضافة إلى ذلك، فإنها تخفف الأعراض المرتبطة بالتهاب الأنف التحسسي الموسمي والشرى المزمن.\n\n- الجرعة: الجرعة الموصى بها هي قرص واحد عن طريق الفم مرة واحدة يوميا أو حسب توجيهات الطبيب.\n\n- الاحتياطات: يجب على المرضى الالتزام بالجرعة الموصوفة واستشارة الطبيب في حالة وجود أي مخاوف أو تعديلات. من المهم اتباع النصائح الطبية فيما يتعلق باستخدام هذه الأقراص، خاصة في حالات الاستخدام لفترة طويلة أو الحالات الصحية الأساسية.', 65.00, 46, NULL, 'zyrtec.jpg', '2024-05-06 19:29:06', '2025-05-15 03:04:54'),
(9, 'Histazine-1 10mg 20 Tablet', 'هيستازين-1 10 مجم - 20 قرص', 'General', 'عام', '- Medical Description:These tablets contain the active ingredient Cetirizine and are used systemically for various conditions.\n\n- Composition: Each tablet contains Cetirizine.\n\n- Usage: They are utilized for the temporary relief of symptoms associated with upper respiratory allergies, such as sneezing and nasal congestion. Additionally, they relieve itching due to urticaria (hives) and treat ocular itching associated with allergic conjunctivitis.\n\n- Dosage: The recommended dosage varies depending on the specific condition being treated and the patient\'s age. Generally, for upper respiratory allergies and urticaria, the typical adult dosage is 10 mg orally once daily. For children, the dosage may be adjusted based on their age and weight. For allergic conjunctivitis, the dosage may vary depending on the formulation (e.g., oral vs. ophthalmic). It\'s important to follow the dosage instructions provided by the physician or as indicated on the medication label.\n\n- Precautions: Patients should adhere to the prescribed dosage and consult their physician for any concerns or adjustments. It\'s important to follow medical advice regarding the use of these tablets, especially in cases of prolonged usage or underlying health conditions.', '- الوصف الطبي: تحتوي هذه الأقراص على المادة الفعالة السيتريزين وتستخدم بشكل نظامي لحالات مختلفة.\n\n- التركيب: كل قرص يحتوي على السيتريزين.\n\n- الاستخدام: يتم استخدامها للتخفيف المؤقت من الأعراض المرتبطة بحساسية الجهاز التنفسي العلوي، مثل العطس واحتقان الأنف. بالإضافة إلى ذلك، فإنها تخفف الحكة الناتجة عن الشرى وتعالج الحكة العينية المرتبطة بالتهاب الملتحمة التحسسي.\n\n- الجرعة: الجرعة الموصى بها تختلف تبعا للحالة المحددة التي يتم علاجها وعمر المريض. بشكل عام، بالنسبة لحساسية الجهاز التنفسي العلوي والشرى، الجرعة النموذجية للبالغين هي 10 ملغ عن طريق الفم مرة واحدة يوميًا. بالنسبة للأطفال، يمكن تعديل الجرعة بناءً على عمرهم ووزنهم. بالنسبة لالتهاب الملتحمة التحسسي، قد تختلف الجرعة اعتمادًا على التركيبة (على سبيل المثال، عن طريق الفم مقابل العيون). من المهم اتباع تعليمات الجرعة التي يقدمها الطبيب أو كما هو موضح على ملصق الدواء.\n\n- الاحتياطات: يجب على المرضى الالتزام بالجرعة الموصوفة واستشارة الطبيب في حالة وجود أي مخاوف أو تعديلات. من المهم اتباع النصائح الطبية فيما يتعلق باستخدام هذه الأقراص، خاصة في حالات الاستخدام لفترة طويلة أو الحالات الصحية الأساسية.', 43.00, 65, NULL, 'histazine.jpg', '2024-05-06 19:29:06', '2025-05-13 18:18:29'),
(10, 'Augmentin 1gm 14 Tablets', 'اوجمنتين 1 جم 14 قرص', 'General', 'عام', '- Medical Description: Augmentin 1gm tablets are broad-spectrum antibiotics used to treat a variety of bacterial infections.\n\n- Composition: Each tablet contains 875 mg of Amoxicillin and 125 mg of Clavulanic acid, totaling 1 g.\n\n- Usage: They are indicated for the treatment of bacterial infections such as sinusitis, pneumonia, ear infections, bronchitis, urinary tract infections, and skin infections.\n\n- Dosage: The usual dosage is one tablet every 12 hours or as directed by a physician.\n\n- Usage: It is recommended to take the tablet with food to reduce the risk of gastrointestinal discomfort.\n\n- Precautions: Patients should complete the full course of medication as prescribed by their physician, even if symptoms improve before the course is completed. It\'s important to follow medical advice regarding the use of this antibiotic, especially in cases of known allergies or other underlying health conditions.', '- الوصف الطبي: أوجمنتين 1 جم أقراص هو مضاد حيوي واسع المدى يستخدم لعلاج مجموعة متنوعة من الالتهابات البكتيرية.\n\n- التركيب: يحتوي كل قرص على 875 ملجم أموكسيسيلين و 125 ملجم حمض كلافولانيك بإجمالي 1 جرام.\n\n- الاستخدام: تستخدم لعلاج الالتهابات البكتيرية مثل التهاب الجيوب الأنفية والالتهاب الرئوي والتهابات الأذن والتهاب الشعب الهوائية والتهابات المسالك البولية والتهابات الجلد.\n\n- الجرعة: الجرعة المعتادة هي قرص واحد كل 12 ساعة أو حسب توجيهات الطبيب.\n\n- الاستخدام: يوصى بتناول القرص مع الطعام لتقليل خطر حدوث اضطرابات في الجهاز الهضمي.\n\n- الاحتياطات: يجب على المرضى إكمال الدورة العلاجية الكاملة كما وصفها الطبيب، حتى لو تحسنت الأعراض قبل اكتمال الدورة. من المهم اتباع النصائح الطبية فيما يتعلق باستخدام هذا المضاد الحيوي، خاصة في حالات الحساسية المعروفة أو غيرها من الحالات الصحية الأساسية.', 131.00, 83, NULL, 'augmentin.jpg', '2024-05-06 19:29:06', '2025-05-15 02:31:29'),
(11, 'Hibiotic 1gm 16 Tablets', 'هاي بيوتيك 1 جم 16 قرص', 'General', 'عام', '- Medical Description: Active Ingredient Amoxicillin 875mg Clavulanic Acid 125mg\r\n\r\n- Usage: Broad Spectrum Antibiotic\r\n\r\n- Mode Of Action: Cell Wall Inhibitor Antibacterial Agent\r\n\r\n- Dose: For Adults: One 1000 mg Tablet Every 12 Hours\r\n\r\n- Special Notes: Many Antibiotics Can Cause Diarrhea. If Diarrhea Is Severe Or Lasts More Than 2 Or 3 Days, Call Your Doctor. Many Antibiotics Can Hypersensitivity Reactions. If There Is Any Hypersensitivity Reaction Call Your Doctor. Follow Your Doctor\'s Instructions About The Amount To Use And The Days Of Treatment.', '- الوصف الطبي: العنصر النشط أموكسيسيلين 875 ملغ حمض كلافولانيك 125 ملغ\r\n\r\n- الاستخدام: مضاد حيوي واسع الطيف\r\n\r\n- طريقة العمل: عامل مضاد للجراثيم مثبط لجدار الخلية\r\n\r\n- الجرعة: للبالغين: قرص واحد 1000 مجم كل 12 ساعة\r\n\r\n- ملاحظات خاصة: العديد من المضادات الحيوية يمكن أن تسبب الإسهال. إذا كان الإسهال شديدًا أو استمر لأكثر من يومين أو ثلاثة أيام، فاتصل بطبيبك. يمكن للعديد من المضادات الحيوية تفاعلات فرط الحساسية. إذا كان هناك أي رد فعل تحسسي، اتصل بطبيبك. اتبع تعليمات طبيبك حول الكمية التي يجب استخدامها وأيام العلاج.', 120.00, 0, NULL, 'hibiotic1gm.jpg', NULL, NULL),
(12, 'Megamox 1gm 14 Tablets', 'ميجاموكس 1 جم 14 قرص', 'General', 'عام', '- Medical Description: This medication contains the active ingredients Amoxicillin (875mg) and Clavulanic Acid (125mg).\r\n\r\n- Usage: It is classified as a broad-spectrum antibiotic.\r\n\r\n- Mode of Action: The medication acts as a cell wall inhibitor antibacterial agent.\r\n\r\n- Dose: For adults, the recommended dosage is one 1000 mg tablet every 12 hours.\r\n\r\n- Special Notes: Many antibiotics can cause diarrhea. If diarrhea is severe or lasts more than 2 or 3 days, call your doctor. Many antibiotics can cause hypersensitivity reactions. If there is any hypersensitivity reaction, call your doctor. Follow your doctor\'s instructions about the amount to use and the duration of treatment.', '- الوصف الطبي: يحتوي هذا الدواء على المكونات النشطة أموكسيسيلين (875 ملغ) وحمض كلافولانيك (125 ملغ).\r\n\r\n- الاستخدام: يصنف كمضاد حيوي واسع الطيف.\r\n\r\n- طريقة العمل: يعمل الدواء كعامل مضاد للجراثيم مثبط لجدار الخلية.\r\n\r\n- الجرعة: للبالغين: الجرعة الموصى بها هي قرص واحد 1000 مجم كل 12 ساعة.\r\n\r\n- ملاحظات خاصة: العديد من المضادات الحيوية يمكن أن تسبب الإسهال. إذا كان الإسهال شديدًا أو استمر لأكثر من يومين أو ثلاثة أيام، فاتصل بطبيبك. العديد من المضادات الحيوية يمكن أن تسبب تفاعلات فرط الحساسية. إذا كان هناك أي رد فعل تحسسي، اتصل بطبيبك. اتبع تعليمات طبيبك حول الكمية التي يجب استخدامها ومدة العلاج.', 94.00, -2, NULL, 'megamox.jpg', NULL, '2024-08-25 11:50:33'),
(13, 'Megamox 625gm 14 Tablets', 'ميجاموكس 625 مجم 14 قرص', 'General', 'عام', '- Medical Description: This medication contains the active ingredients Amoxicillin (500mg) and Clavulanic Acid (125mg).\r\n\r\n- Usage: It is classified as a broad-spectrum antibiotic.\r\n\r\n- Mode of Action: The medication acts as a cell wall inhibitor antibacterial agent.\r\n\r\n- Dose: For adults, the recommended dosage is one 625 mg tablet every 12 hours.\r\n\r\n- Special Notes: Many antibiotics can cause diarrhea. If diarrhea is severe or lasts more than 2 or 3 days, call your doctor. Many antibiotics can cause hypersensitivity reactions. If there is any hypersensitivity reaction, call your doctor. Follow your doctor\'s instructions about the amount to use and the duration of treatment.', '- الوصف الطبي: يحتوي هذا الدواء على المكونات النشطة أموكسيسيلين (500 ملغ) وحمض كلافولانيك (125 ملغ).\r\n\r\n- الاستخدام: يصنف كمضاد حيوي واسع الطيف.\r\n\r\n- طريقة العمل: يعمل الدواء كعامل مضاد للجراثيم مثبط لجدار الخلية.\r\n\r\n- الجرعة: للبالغين: الجرعة الموصى بها هي قرص واحد 625 مجم كل 12 ساعة.\r\n\r\n- ملاحظات خاصة: العديد من المضادات الحيوية يمكن أن تسبب الإسهال. إذا كان الإسهال شديدًا أو استمر لأكثر من يومين أو ثلاثة أيام، فاتصل بطبيبك. العديد من المضادات الحيوية يمكن أن تسبب تفاعلات فرط الحساسية. إذا كان هناك أي رد فعل تحسسي، اتصل بطبيبك. اتبع تعليمات طبيبك حول الكمية التي يجب استخدامها ومدة العلاج.', 60.00, 9, NULL, 'megamox625gm.jpg', NULL, '2025-05-15 02:31:29'),
(14, 'Entresto 50 mg 28 Tablets', 'اینتریستو 50 مجم 28 قرص', 'Heart', 'القلب', '- Medical Description: These tablets are used to treat heart muscle weakness.\r\n\r\n- Composition: Each tablet contains 24 mg of Sacubitril and 26 mg of Valsartan.\r\n\r\n- Usage: They are indicated for heart muscle problems.\r\n\r\n- Dosage: The usual dosage is twice daily with a dose determined by the prescribing physician.\r\n\r\n- Packaging: Each pack contains 28 tablets.', '- الوصف الطبي: تستخدم هذه الأقراص في علاج ضعف عضلة القلب.\r\n\r\n- التركيب: يحتوي كل قرص على 24 ملجم ساكوبتريل و 26 ملجم فالسارتان.\r\n\r\n- الاستخدام: يستخدم لعلاج مشاكل عضلة القلب.\r\n\r\n- الجرعة: الجرعة المعتادة هي مرتين يومياً، ويتم تحديد الجرعة من قبل الطبيب المعالج.\r\n\r\n- التعبئة والتغليف: كل علبة تحتوي على 28 قرص.', 1369.00, -156, NULL, 'entresto.jpg', NULL, '2025-01-22 15:11:49'),
(15, 'Flixonase nasal spray', 'فليكسونيز بخاخ انف', 'Nose', 'الأنف', '- Medical Description: This nasal spray is used to treat sinusitis.\r\n\r\n- Composition: It contains a concentration of 0.05% Fluticasone.\r\n\r\n- Usage: It is utilized for the treatment of chronic or seasonal sinusitis.\r\n\r\n- Dosage: The usual dosage is 2 sprays into each nostril once daily or as prescribed by the treating physician.\r\n\r\n- Packaging: Each pack contains 120 sprays.', '- الوصف الطبي: يستخدم هذا البخاخ الأنفي لعلاج التهاب الجيوب الأنفية.\r\n\r\n- التركيب: يحتوي على تركيز 0.05% فلوتيكاسون.\r\n\r\n- الاستخدام: يستخدم لعلاج التهاب الجيوب الأنفية المزمن أو الموسمي.\r\n\r\n- الجرعة: الجرعة المعتادة هي بختين في كل فتحة أنف مرة واحدة يومياً أو حسب إرشادات الطبيب المعالج.\r\n\r\n- التعبئة والتغليف: تحتوي كل عبوة على 120 بخة.', 90.00, 115, NULL, 'flixonase.jpg', NULL, NULL),
(16, 'Nasacort Aqua 55 micro 120 dose spray', 'ناساکورت اکوا 55 میکرو 120 جرعة بخاخة', 'Nose', 'الأنف', '- Medical Description: This nasal spray is used to treat seasonal and perennial nasal allergies.\r\n\r\n- Composition: Each spray contains 55 micrograms of Triamcinolone.\r\n\r\n- Usage: It is typically administered as two sprays into each nostril once daily or as directed by the treating physician.\r\n\r\n- Precaution before First Use: Before the initial use of the device, it is necessary to shake the device well and spray 5 times into the air away from the face.\r\n\r\n- Packaging: Each pack contains 120 sprays (equivalent to 30 days of use).', '- الوصف الطبي: يستخدم هذا البخاخ الأنفي لعلاج حساسية الأنف الموسمية والدائمة.\r\n\r\n- التركيب: تحتوي كل بخة على 55 ميكروجرام تريامسينولون.\r\n\r\n- الاستخدام: يتم إعطاؤه عادة كبختين في كل فتحة أنف مرة واحدة يوميًا أو حسب توجيهات الطبيب المعالج.\r\n\r\n- الاحتياطات قبل الاستخدام الأول: قبل الاستخدام الأولي للجهاز، من الضروري هز الجهاز جيدًا ورشه 5 مرات في الهواء بعيدًا عن الوجه.\r\n\r\n- التعبئة والتغليف: تحتوي كل عبوة على 120 بخة (ما يعادل 30 يومًا من الاستخدام).', 100.00, 12, 17, 'nasacort.jpg', NULL, '2025-05-17 00:29:36'),
(17, 'Adol Sinus - 24 Caplets', 'ادول ساينس 24 كبسولة', 'Nose', 'الأنف', '- Active Ingredients: It contains a combination of Paracetamol and Pseudoephedrine.\r\n\r\n- Usage: It is used to relieve symptoms of nasal congestion, fever, and accompanying headaches associated with respiratory conditions such as sinusitis, colds, and nasal allergies.\r\n\r\n- Dosage for Adults: Two tablets every 6 hours, up to a maximum of 4 times daily.\r\n\r\n- Precautions: Consult your doctor before use if you have high blood pressure, heart disease, prostate enlargement, glaucoma, or liver disease.', '- المكونات النشطة: يحتوي على مزيج من الباراسيتامول والسودوإيفيدرين.\r\n\r\n- الاستخدام: يستخدم لتخفيف أعراض احتقان الأنف والحمى والصداع المصاحب لأمراض الجهاز التنفسي مثل التهاب الجيوب الأنفية ونزلات البرد وحساسية الأنف.\r\n\r\n- الجرعة للبالغين: قرصين كل 6 ساعات، بحد أقصى 4 مرات يوميًا.\r\n\r\n- الاحتياطات: استشر طبيبك قبل الاستخدام إذا كنت تعاني من ارتفاع ضغط الدم أو أمراض القلب أو تضخم البروستاتا أو الجلوكوما أو أمراض الكبد.', 24.00, 5, NULL, 'adol.jpg', NULL, '2024-08-24 23:19:20'),
(18, 'Clerest 14 capsules', 'کلیرست 14 كبسولة', 'Nose', 'الأنف', '- Medical Description: Capsules for Treating Nasal Allergies and Congestion.\n\n- Composition: Each capsule contains Cetirizine and Pseudoephedrine.\n\n- Usual Dosage: Take one capsule twice daily or as prescribed by the treating physician.\n\n- Packaging: Each pack contains 14 capsules.', '- الوصف الطبي: كبسولات لعلاج حساسية واحتقان الأنف:\r\n\r\n- التركيب: تحتوي كل كبسولة على السيتريزين والسودوإيفيدرين.\r\n\r\n- الجرعة المعتادة: تناول كبسولة واحدة مرتين يومياً أو حسب إرشادات الطبيب المعالج.\r\n\r\n- التعبئة والتغليف: تحتوي كل علبة على 14 كبسولة.', 27.00, 21, NULL, 'clerest.jpg', NULL, '2024-12-04 17:47:04'),
(19, 'Decanset SR 20 tablets', 'دیکانسیت اس ار 20 قرص', 'Nose', 'الأنف', '- Medical Description: Extended-Release Tablets for Treating Nasal Congestion and Sinus Infections:\r\n\r\n- Composition: Each tablet contains 5 mg of Cetirizine and 120 mg of Pseudoephedrine.\r\n\r\n- Usage: It is used for nasal congestion and sinus infections.\r\n\r\n- Usual Dosage: Take one tablet every 12 hours, to be swallowed whole and not chewed.\r\n\r\n- Precautions: Use with caution in elderly individuals and those with certain chronic conditions such as elevated eye pressure and prostate enlargement.', '- الوصف الطبي: أقراص ممتدة المفعول لعلاج احتقان الأنف والتهابات الجيوب الأنفية:\r\n\r\n- التركيب: يحتوي كل قرص على 5 ملجم سيتريزين و 120 ملجم سودوإيفيدرين.\r\n\r\n- الاستخدام: يستخدم في علاج احتقان الأنف والتهابات الجيوب الأنفية.\r\n\r\n- الجرعة المعتادة: قرص واحد كل 12 ساعة، يتم ابتلاعه كاملاً ولا يمضغ.\r\n\r\n- الاحتياطات: استخدم بحذر عند كبار السن والذين يعانون من حالات مزمنة معينة مثل ارتفاع ضغط العين وتضخم البروستاتا.', 26.00, 5, NULL, 'decanset.jpg', NULL, NULL),
(20, 'Dermovate cream 25 gm', 'ديرموفيت 25 جم كريم', 'Skin Diseases', 'الأمراض الجلدية', '- Medical Description: Strong Anti-Inflammatory Cream for Treating Severe Skin Inflammation such as Eczema:\r\n\r\n- Composition: It contains 0.05% Clobetasol Propionate.\r\n\r\n- Usage: It is used for conditions like psoriasis, erythroderma, and other severe skin inflammations.\r\n\r\n- Frequency of Use: Apply once or twice daily as directed by the treating physician.\r\n\r\n- Precautions: It is not recommended for use in children under one year old.\r\n\r\n- Packaging: Each pack contains 25 grams.', '- الوصف الطبي: كريم قوي مضاد للالتهابات لعلاج الالتهابات الجلدية الشديدة مثل الأكزيما:\r\n\r\n- التركيب: يحتوي على 0.05% كلوبيتاسول بروبيونات.\r\n\r\n- الاستخدام: يتم استخدامه لحالات مثل الصدفية، واحمرار الجلد، وغيرها من الالتهابات الجلدية الشديدة.\r\n\r\n- تكرار الاستخدام: يستخدم مرة أو مرتين يوميًا حسب توجيهات الطبيب المعالج.\r\n\r\n- الاحتياطات: لا ينصح باستخدامه للأطفال أقل من سنة واحدة.\r\n\r\n- التعبئة والتغليف: تحتوي كل علبة على 25 جرام.', 27.00, -373, 21, 'dermovate.jpg', NULL, '2025-05-14 00:10:41'),
(21, 'Elica-m Cream 30 gm', 'اليكا ام 30 جم كريم', 'Skin Diseases', 'الأمراض الجلدية', '- Medical Description: Cream for Skin Inflammation Associated with Fungal Infections:\r\n\r\n- Composition: It contains both Mometasone and Miconazole.\r\n\r\n- Usage: Apply a thin layer once or twice daily or as directed by the physician.\r\n\r\n- Packaging: Each pack contains 30 grams.', '- الوصف الطبي: كريم لعلاج التهابات الجلد المصاحبة للعدوى الفطرية:\r\n\r\n- التركيب: يحتوي على كل من الموميتازون والميكونازول.\r\n\r\n- الاستخدام: ضعي طبقة رقيقة مرة أو مرتين يوميًا أو حسب توجيهات الطبيب.\r\n\r\n- التعبئة والتغليف: تحتوي كل علبة على 30 جرام.', 34.00, -85, NULL, 'elica.jpg', NULL, '2025-05-17 06:04:17'),
(22, 'Betaderm cream 15 gm', 'بیتادرم 15 جرام كريم', 'Skin Diseases', 'الأمراض الجلدية', '- Medical Description: Yata Derm Cream Anti-Inflammatory\r\n\r\n- Composition: It contains the active ingredient Betamethasone.\r\n\r\n- Usage: It is a potent topical corticosteroid for adults and children over one year old, used to relieve inflammation and itching in conditions such as skin allergies, psoriasis, and insect bites.\r\n\r\n- Usage Method: Apply a thin layer covering the affected area, gently massaging once to twice daily or as directed by the physician.\r\n\r\n- Precautions: Yata Derm should not be used to treat acne, itching around the genital organs, or itching around the mouth.\r\n\r\n- Storage: Store at temperatures not exceeding 30 degrees Celsius.', '- الوصف الطبي: كريم ياتا ديرم مضاد للالتهابات\r\n\r\n- التركيب: يحتوي على المادة الفعالة بيتاميثازون.\r\n\r\n- الاستخدام: وهو كورتيكوستيرويد موضعي قوي للبالغين والأطفال الذين تزيد أعمارهم عن سنة واحدة، يستخدم لتخفيف الالتهاب والحكة في حالات مثل حساسية الجلد والصدفية ولدغات الحشرات.\r\n\r\n- طريقة الاستخدام: توضع طبقة رقيقة تغطي المنطقة المصابة، وتدلك بلطف مرة إلى مرتين يومياً أو حسب توجيهات الطبيب.\r\n\r\n- الاحتياطات: لا ينبغي استخدام ياتا ديرم لعلاج حب الشباب، أو الحكة حول الأعضاء التناسلية، أو الحكة حول الفم.\r\n\r\n- التخزين: يحفظ في درجة حرارة لا تزيد عن 30 درجة مئوية.', 11.50, -57, NULL, 'betaderm.jpg', NULL, '2024-12-06 15:21:20'),
(23, 'Fucicort cream 15 gm', 'فيوسيكورت 15 كريم جم', 'Skin Diseases', 'الأمراض الجلدية', '- Medical Description: Cream for Topical Treatment of Inflamed Skin Conditions (such as eczema or dermatitis) and Bacterial Infections:\r\n\r\nComposition: It contains 2% Fusidic Acid, an antibiotic, and 0.1% Betamethasone, a corticosteroid.\r\n\r\nDosage: Apply twice daily for up to two weeks. If improvement is not observed within 7 days, discontinue cream use.', '- الوصف الطبي: كريم لعلاج موضعي لحالات الجلد الملتهبة (مثل الأكزيما أو التهاب الجلد) والالتهابات البكتيرية:\r\n\r\nالتركيب: يحتوي على 2% حمض الفوسيديك وهو مضاد حيوي و0.1% بيتاميثازون وهو كورتيكوستيرويد.\r\n\r\nالجرعة: يستخدم مرتين يومياً لمدة تصل إلى أسبوعين. إذا لم يلاحظ التحسن خلال 7 أيام، توقف عن استخدام الكريم.', 32.00, -70, NULL, 'fucicort.jpg', NULL, '2024-12-16 01:08:02'),
(24, 'Quadriderm Cream 30 gm', 'كوادريديرم كريم 30 جم', 'Skin Diseases', 'الأمراض الجلدية', '- The topical cream contains:\r\n Betamethasone (0.5 mg/g), an anti-inflammatory.\r\n Gentamicin (1 mg/g), an antibiotic.\r\n Iodochlorhydroxyquin (10 mg/g), an antiparasitic.\r\n Tolnaftate (10 mg/g), an antifungal.\r\n\r\n- Usage: It is used to relieve inflammation.\r\n\r\n- Dosage: Apply a thin layer of the cream three times daily or as prescribed by the physician, depending on the severity of the condition.', '- الكريم الموضعي يحتوي على :\r\n  بيتاميثازون (0.5 ملغم/جم) مضاد للالتهابات.\r\n  جنتاميسين (1 ملغم/جم) مضاد حيوي.\r\n  يودوكلورهيدروكسيكين (10 ملغم/جم)، مضاد للطفيليات.\r\n  تولنافتات (10 ملغ/جم)، مضاد للفطريات.\r\n\r\n- الاستخدام: يستخدم لتخفيف الالتهاب.\r\n\r\n- الجرعة: توضع طبقة رقيقة من الكريم ثلاث مرات يومياً أو حسب وصفة الطبيب حسب شدة الحالة.', 32.00, -5, NULL, 'quadriderm.jpg', NULL, '2025-05-04 12:30:36'),
(25, 'Luna', 'لونا', 'Body Care', 'العناية بالجسم ', '- Luna Shea Butter Foot Cracks Removal Cream - 60g: A moisturizing cream for the skin containing shea butter and glycerin to soften and remove severe skin cracks and dryness.\r\n\r\n- Luna Emollient Cream for Hands and Body - 75g: A moisturizing cream for daily use, enriched with cocoa butter to protect the skin from dryness and provide deep hydration. It is recommended to use it twice daily for optimal results.\r\n\r\n- Luna Lip Treatment Emollient - 10ml: Specially formulated for sensitive lips, this treatment contains enhanced moisturizers with cocoa butter to protect them from weather-induced dryness.\r\n\r\n- Luna Emollient Cream for Hands and Heels - 20g: A moisturizing cream specifically designed to renew skin cells and remove cracks, thanks to its rich formula containing glycerin.', '- كريم لونا لإزالة تشققات القدمين بزبدة الشيا - 60 جرام: كريم مرطب للبشرة يحتوي على زبدة الشيا والجلسرين لتنعيم وإزالة تشققات الجلد الشديدة وجفافه.\r\n\r\n- كريم لونا المطري لليدين والجسم - 75 جرام: كريم مرطب للاستخدام اليومي غني بزبدة الكاكاو لحماية البشرة من الجفاف وتوفير ترطيب عميق. ينصح باستخدامه مرتين يومياً للحصول على أفضل النتائج.\r\n\r\n- مرطب معالجة الشفاه لونا - 10 مل: تم تصميم هذا العلاج خصيصًا للشفاه الحساسة، ويحتوي على مرطبات معززة بزبدة الكاكاو لحمايتها من الجفاف الناجم عن الطقس.\r\n\r\n- كريم لونا المطري لليدين والكعبين - 20 جرام: كريم مرطب مصمم خصيصًا لتجديد خلايا البشرة وإزالة التشققات بفضل تركيبته الغنية التي تحتوي على الجلسرين.', 155.00, 9, NULL, 'luna.jpg', NULL, NULL),
(26, 'Macro Panthenol Cream 50 gm', 'ماكرو بانثينول 50 جرام كريم', 'Body Care', 'العناية بالجسم ', '- Medical Description: Topical Cream used as a Moisturizer, Soothing Agent, and Anti-Irritant:\r\n\r\n- Composition: It contains Panthenol, Glycerin, and Paraffin Oil (50 grams).\r\n\r\n- Usage: This cream acts as a moisturizer while soothing and calming irritated skin. It also prevents skin dryness.\r\n\r\n- Dosage: Apply once or twice daily.', '- الوصف الطبي: كريم موضعي يستخدم كمرطب ومهدئ ومضاد للتهيج:\r\n\r\n- التركيب: يحتوي على البانثينول والجلسرين وزيت البارافين (50 جرام).\r\n\r\n- الاستخدام: يعمل هذا الكريم كمرطب بينما يهدئ ويهدئ البشرة المتهيجة. كما أنه يمنع جفاف الجلد.\r\n\r\n- الجرعة: يستخدم مرة أو مرتين يومياً.', 45.00, -80, NULL, 'marcopanthenol.jpg', NULL, '2025-04-08 20:48:23'),
(27, 'Bioderma autoderm cream 200 ml', 'بيوديرما اتو ديرم كريم 200 مل', 'Body Care', 'العناية بالجسم ', '- Medical Description: Topical Cream used as a Moisturizer, Soothing Agent, and Anti-Irritant:\r\n\r\n- Composition: It contains Panthenol, Glycerin, and Paraffin Oil (50 grams).\r\n\r\n- Usage: This cream acts as a moisturizer while soothing and calming irritated skin. It also prevents skin dryness.\r\n\r\n- Dosage: Apply once or twice daily.', '- الوصف الطبي: كريم موضعي يستخدم كمرطب ومهدئ ومضاد للتهيج:\r\n\r\n- التركيب: يحتوي على البانثينول والجلسرين وزيت البارافين (50 جرام).\r\n\r\n- الاستخدام: يعمل هذا الكريم كمرطب بينما يهدئ ويهدئ البشرة المتهيجة. كما أنه يمنع جفاف الجلد.\r\n\r\n- الجرعة: يستخدم مرة أو مرتين يومياً.', 950.00, 75, NULL, 'bioderma.jpg', NULL, NULL),
(28, 'Aroma argan oil face wash 300 ml', 'اروما غسول وجه زيت الارجان 300 مل', 'Skin Care', 'العناية بالبشرة', '- Deeply cleanses and moisturizes the skin while balancing its oil secretion to leave it clean and hydrated.\r\n\r\n- Usage: Wash the face and neck in circular motions and rinse with water. Use twice daily, morning and evening. \r\n\r\n- Avoid contact with eyes. If contact occurs, wash it well with plenty of water.', '- ينظف البشرة ويرطبها بعمق مع موازنة إفرازاتها الدهنية ليتركها نظيفة ورطبة.\r\n\r\n- الاستخدام: يغسل الوجه والرقبة بحركات دائرية ويشطف بالماء. استخدميه مرتين يومياً، صباحاً ومساءً.\r\n\r\n- تجنب ملامسة العينين. في حالة حدوث تلامس، اغسله جيدًا بالكثير من الماء.', 320.00, -9, NULL, 'aroma.jpg', NULL, '2025-05-14 14:23:07'),
(29, 'Aroma Vitamin C Facial Wash 300 ml', 'اروما غسول وجه فيتامين سي 300 مل', 'Skin Care', 'العناية بالبشرة', '- Deeply cleanses the skin and is considered the ideal cleanser for individuals with skin discoloration or uneven skin tone.\r\n\r\n- Usage: Wash the face and neck in circular motions and rinse with water. Use twice daily, morning and evening.\r\n\r\n- Avoid contact with eyes. If contact occurs, wash it well with plenty of water.', '- ينظف البشرة بعمق ويعتبر المنظف المثالي للأفراد الذين يعانون من تغير لون البشرة أو تفاوت لون البشرة.\r\n\r\n- الاستخدام: يغسل الوجه والرقبة بحركات دائرية ويشطف بالماء. استخدميه مرتين يومياً، صباحاً ومساءً.\r\n\r\n- تجنب ملامسة العينين. في حالة حدوث تلامس، اغسله جيدًا بالكثير من الماء.', 320.00, 8, NULL, 'aromavitamin.jpg', NULL, '2025-05-13 22:53:35'),
(30, 'CeraVe S.A. 473 ml', 'سيرافي اس ايه  473 مل', 'Skin Care', 'العناية بالبشرة', '- S.A. Smoothing Cleanser is a facial cleanser designed for normal, dry, and rough skin with 437ml of Salicylic Acid.\r\n- Effectively cleanses the skin to remove dirt.\r\n- Salicylic acid exfoliates the skin to enhance its smoothness and evenness.\r\n- Enriched with antioxidant Vitamin D.\r\n- Ceramides help repair the skin\'s natural barrier and maintain it.\r\n- Hyaluronic acid preserves natural moisture in the skin layers.\r\n- Niacinamide helps soothe the skin.\r\n- Fragrance-free, non-allergenic, and does not cause blackheads.\r\n- Developed in collaboration with dermatologists.', '- S. A. Smoothing Cleanser هو منظف للوجه مصمم للبشرة العادية والجافة والخشنة مع 437 مل من حمض الساليسيليك.\r\n- ينظف البشرة بشكل فعال لإزالة الأوساخ.\r\n- يعمل حمض الساليسيليك على تقشير البشرة لتعزيز نعومتها وتوازنها.\r\n- غني بفيتامين د المضاد للأكسدة.\r\n- يساعد السيراميد على إصلاح الحاجز الطبيعي للبشرة والحفاظ عليه.\r\n- يحافظ حمض الهيالورونيك على الرطوبة الطبيعية في طبقات الجلد.\r\n- يساعد النياسيناميد على تهدئة البشرة.\r\n- خالي من العطور ولا يسبب الحساسية ولا يسبب الرؤوس السوداء.\r\n- تم تطويره بالتعاون مع أطباء الجلد.', 749.00, 13, NULL, 'cerave.jpg', NULL, '2024-12-01 20:43:44'),
(31, 'Nervalta 60 mg 10 capsules', 'نير فالتا 60 مجم 10 كبسولة', 'Anti-Depressant', 'الاضطرابات النفسية', '- Medical Description: Slow-release capsules containing Duloxetine Hydrochloride 60mg.\r\n\r\n- Composition: Each capsule contains 60mg of Duloxetine Hydrochloride.\r\n\r\n- Usage: Indicated for:\r\n - Major depressive disorder.\r\n - Generalized anxiety disorder.\r\n - Diabetic peripheral neuropathic pain.\r\n - Fibromyalgia.\r\n - Chronic musculoskeletal pain.\r\n\r\n- Dosage: As prescribed by the treating physician. The capsules should be swallowed whole and should not be chewed or crushed. The capsule should not be opened and its contents should not be sprinkled on food or mixed with liquids.\r\n\r\n- Precautions:\r\n- Contraindicated in patients taking monoamine oxidase inhibitors (MAOIs) and those with narrow-angle glaucoma.\r\n- Clinical worsening and suicide risk.\r\n- Hepatotoxicity.\r\n- Orthostatic hypotension and syncope.\r\n- Serotonin syndrome or NMS-like reactions.\r\n- Abnormal bleeding.\r\n- Mania/hypomania.\r\n- Seizures.\r\n- Hyponatremia.\r\n- Urinary hesitancy and retention.', '- الوصف الطبي: كبسولات بطيئة المفعول تحتوي على دولوكسيتين هيدروكلوريد 60 ملغ.\r\n\r\n- التركيب: تحتوي كل كبسولة على 60 ملغ من دولوكسيتين هيدروكلوريد.\r\n\r\n- الاستخدام: مخصص لـ:\r\n - اضطراب اكتئابي حاد.\r\n - اضطراب القلق العام.\r\n - آلام الأعصاب الطرفية الناتجة عن مرض السكري.\r\n - الفيبروميالجيا.\r\n - آلام عضلية هيكلية مزمنة.\r\n\r\n- الجرعة: حسب إرشادات الطبيب المعالج. يجب بلع الكبسولات كاملة ولا يجوز مضغها أو سحقها. لا يجوز فتح الكبسولة ولا يجوز نثر محتوياتها على الطعام أو خلطها بالسوائل.\r\n\r\n- احتياطات:\r\n- يمنع استخدامه للمرضى الذين يتناولون مثبطات أوكسيديز أحادي الأمين (MAOIs) والذين يعانون من الجلوكوما ضيقة الزاوية.\r\n- التدهور السريري وخطر الانتحار.\r\n- السمية الكبدية.\r\n- انخفاض ضغط الدم الانتصابي والإغماء.\r\n- متلازمة السيروتونين أو تفاعلات تشبه NMS.\r\n- نزيف غير طبيعي.\r\n- الهوس/الهوس الخفيف.\r\n- النوبات.\r\n- نقص صوديوم الدم.\r\n- تردد واحتباس البول.', 78.00, 0, NULL, 'nervalta.jpg', NULL, NULL),
(32, 'Cipralex 10 mg 28 tablets', 'سبرالكس 10 مجم 28 قرص', 'Anti-Depressant', 'الاضطرابات النفسية', '- Medical Description: Antidepressant tablets containing Escitalopram 10mg per tablet.\r\n\r\n- Usage:\r\n - Adjunctive treatment for major \r\n   depressive disorder (MDD).\r\n - Treatment for acute generalized anxiety \r\n   disorder (GAD) in adults.\r\n\r\n- Dosage: As prescribed by the doctor.', '- الوصف الطبي: أقراص مضادة للاكتئاب تحتوي على إسيتالوبرام 10 ملغ للقرص الواحد.\r\n\r\n- الاستخدام:\r\n - علاج مساعد لاضطراب الاكتئاب الشديد (MDD).\r\n - علاج اضطراب القلق العام الحاد (GAD) لدى البالغين.\r\n\r\n- الجرعة: حسب وصفة الطبيب.', 300.00, 23, NULL, 'cipralex.jpg', NULL, NULL),
(33, 'Lustral 50 mg 20 tablets', 'لوسترال 50 مجم 20 قرص', 'Anti-Depressant', 'الاضطرابات النفسية', '- Medical Description: Antidepressant tablets containing 50mg of Sertraline.\r\n\r\n- Usage: A medication used to treat psychiatric disorders such as depression and obsessive-compulsive disorder (OCD).\r\n\r\n- Dosage: To be determined by the doctor.', '- الوصف الطبي: أقراص مضادة للاكتئاب تحتوي على 50 ملغ من سيرترالين.\r\n\r\n- الاستخدام: دواء يستخدم لعلاج الاضطرابات النفسية مثل الاكتئاب والوسواس القهري.\r\n\r\n- الجرعة: يحددها الطبيب.', 101.00, 9, NULL, 'lustral.jpg', NULL, NULL),
(34, 'Seroquel 25 mg 10 tablets', 'سيروكويل 25 مجم 10 قرص', 'Anti-Depressant', 'الاضطرابات النفسية', '- Medical Description: Tablets for the treatment of schizophrenia, psychosis, and certain other conditions, each containing 25mg of Quetiapine.\r\n\r\n- Usage:\r\n - Schizophrenia.\r\n - Bipolar disorder.\r\n - Some cases of depression.\r\n - Some doctors may use it to treat addiction and insomnia.\r\n\r\n- Dosage: To be determined by the treating physician based on the patient\'s condition.\r\n\r\n- Packaging: 10 tablets per pack.', '- الوصف الطبي: أقراص لعلاج الفصام والذهان وبعض الحالات الأخرى، يحتوي كل منها على 25 ملجم من الكيوتيابين.\r\n\r\n- الاستخدام:\r\n - فُصام.\r\n - اضطراب ذو اتجاهين.\r\n - بعض حالات الاكتئاب.\r\n - قد يستخدمه بعض الأطباء لعلاج الإدمان والأرق.\r\n\r\n - الجرعة: يحددها الطبيب المعالج حسب حالة المريض.\r\n\r\n- العبوة: 10 أقراص لكل علبة.', 30.00, 11, NULL, 'seroquel.jpg', NULL, NULL),
(35, 'Prozac 20mg 14 capsules', 'بروزاك 20 مجم 14 كبسولة', 'Anti-Depressant', 'الاضطرابات النفسية', '- Medical Description: Antidepressant capsules, with each capsule containing 20mg of Fluoxetine.\r\n\r\n- Usage:\r\n- Depression.\r\n- Obsessive-compulsive disorder.\r\n- Some cases of panic disorder.\r\n\r\n- Dosage: To be determined by the treating physician.\r\n\r\n- Precautions: Consult a doctor before use during breastfeeding.', '- الوصف الطبي: كبسولات مضادة للاكتئاب، تحتوي كل كبسولة على 20 ملجم من مادة فلوكستين.\r\n\r\n- الاستخدام:\r\n- اكتئاب.\r\n- اضطراب الوسواس القهري.\r\n- بعض حالات اضطراب الهلع.\r\n\r\n- الجرعة: يتم تحديدها من قبل الطبيب المعالج.\r\n\r\n- الاحتياطات: استشر الطبيب قبل الاستخدام أثناء الرضاعة الطبيعية.', 89.00, 15, NULL, 'prozac.jpg', '2024-05-17 15:29:54', '2024-05-17 17:24:31'),
(36, 'Quitapex 25mg 30 tablets', 'كويتابكس 25 مجم 30 قرص', 'Anti-Depressant', 'الاضطرابات النفسية', '- Medical Description: Tablets for the treatment of schizophrenia, psychosis, and some other conditions, with each tablet containing 25mg of Quetiapine.\r\n\r\n- Usage:\r\n- Schizophrenia.\r\n- Some cases of depression.\r\n- Some doctors may use it to treat addiction and insomnia.\r\n\r\n- Dosage: To be determined by the treating physician based on the patient\'s condition.\r\n\r\n- Packaging: 10 tablets per package.', '- الوصف الطبي: أقراص لعلاج الفصام والذهان وبعض الحالات الأخرى، حيث يحتوي كل قرص على 25 ملجم من الكيوتيابين.\r\n\r\n- الاستخدام:\r\n- فُصام.\r\n- بعض حالات الاكتئاب.\r\n- قد يستخدمه بعض الأطباء لعلاج الإدمان والأرق.\r\n\r\n- الجرعة: يحددها الطبيب المعالج حسب حالة المريض.\r\n\r\n- العبوة: 10 أقراص في العبوة.', 63.00, 20, NULL, 'quitapex.jpg', '2024-05-17 16:01:27', '2024-05-17 16:01:27'),
(37, 'Esctikana 10 mg 28 Tablets', 'استيكانا 10 مجم 28 قرص مغلف', 'Anti-Depressant', 'الاضطرابات النفسية', '- Medical Description: Antidepressant tablets.\r\n\r\n- Composition: Each tablet contains 10mg of Escitalopram.\r\n\r\n- Dosage: The usual dose is 5-20mg once daily, with or without food.\r\n\r\n- Precautions: Dosage may vary depending on the individual\'s condition and the doctor\'s recommendation.', '- الوصف الطبي: أقراص مضادة للاكتئاب.\r\n\r\n- التركيب: يحتوي كل قرص على 10 ملغ من إسيتالوبرام.\r\n\r\n- الجرعة: الجرعة المعتادة هي 5-20 مجم مرة واحدة يومياً، مع أو بدون الطعام.\r\n\r\n- الاحتياطات: قد تختلف الجرعة حسب حالة الفرد وتوصية الطبيب.', 52.00, 19, NULL, 'esctikana.jpg', '2024-05-17 16:30:57', '2024-05-17 16:30:57'),
(38, 'Aripiprazole 5 mg 30 Tablets', 'اريبيبرازول 5 مجم 30 قرص مغلف', 'Anti-Depressant', 'الاضطرابات النفسية', '- Medical Description: Antipsychotic tablets containing 5mg of Aripiprazole.\r\n\r\n- Usage:\r\n- Schizophrenia.\r\n- Bipolar I disorder.\r\n- Adjunctive treatment of major depressive disorder.\r\n- Irritability associated with autistic disorder.\r\n\r\n- Dosage: The dosage typically ranges from 2 to 15mg depending on the condition and under the supervision of a doctor.', '- الوصف الطبي: أقراص مضادة للذهان تحتوي على 5 ملجم أريبيبرازول.\r\n\r\n- الاستخدام:\r\n- فُصام.\r\n- اضطراب ثنائي القطب من النوع الأول.\r\n- علاج مساعد لاضطراب الاكتئاب الشديد.\r\n- التهيج المصاحب لاضطراب التوحد.\r\n\r\n- الجرعة: تتراوح الجرعة عادة من 2 إلى 15 ملغ حسب الحالة وتحت إشراف الطبيب.', 82.00, 9, NULL, 'aripiprazole.jpg', '2024-05-17 17:26:09', '2024-05-17 17:26:09'),
(39, 'Cipramaline 10 mg 20 tablets', 'سبرامالين 10 مجم 20 قرص مغلف', 'Anti-Depressant', 'الاضطرابات النفسية', '- Medical Description: Antidepressant tablets containing 10mg of Escitalopram.\r\n\r\n- Usage:\r\n- Supplementary treatment for major depressive disorder (MDD) in adults and adolescents aged 12 to 17 years.\r\n- Treatment of acute generalized anxiety disorder (GAD) in adults.\r\n\r\n- Dosage: The recommended dosage is from 10 to 20mg once daily as directed by a physician.', '- الوصف الطبي: أقراص مضادة للاكتئاب تحتوي على 10 ملجم من إسيتالوبرام.\r\n\r\n- الاستخدام:\r\n- العلاج التكميلي لاضطراب الاكتئاب الشديد (MDD) لدى البالغين والمراهقين الذين تتراوح أعمارهم بين 12 إلى 17 عامًا.\r\n- علاج اضطراب القلق العام الحاد (GAD) لدى البالغين.\r\n\r\n- الجرعة: الجرعة الموصى بها هي من 10 إلى 20 ملغ مرة واحدة يومياً حسب توجيهات الطبيب.', 110.00, 19, NULL, 'cipramaline.jpg', '2024-05-21 14:59:39', '2024-05-21 14:59:39'),
(40, 'Rowatinex 45 Capsules', 'رواتينكس 45 كبسولة', 'Liver', 'أمراض الكبد', '- Medical Description: Rowatinex capsules for supporting urinary system health.\r\n\r\n- Usage: \r\n- Works to dissolve kidney stones and support urinary system health. \r\n- Reduces pain associated with kidney colic and urinary tract spasms.\r\n\r\n- Dosage: Unless otherwise prescribed by a physician, the recommended dosage for adults is 4-5 capsules daily before meals. Rowatinex should not be used for the treatment of urinary stones without consulting a doctor, especially in children.', '- الوصف الطبي: كبسولات رواتينكس لدعم صحة الجهاز البولي.\r\n\r\n- الاستخدام:\r\n- يعمل على إذابة حصوات الكلى ودعم صحة الجهاز البولي.\r\n- يخفف الألم المصاحب للمغص الكلوي وتشنجات المسالك البولية.\r\n\r\n- الجرعة: ما لم يصف الطبيب خلاف ذلك، الجرعة الموصى بها للبالغين هي 4-5 كبسولات يوميا قبل الوجبات. لا ينبغي استخدام رواتينكس لعلاج حصوات المسالك البولية دون استشارة الطبيب، وخاصة عند الأطفال.', 46.50, 19, NULL, 'rowatinex.jpg', '2024-05-23 14:42:05', '2024-05-23 14:42:05'),
(41, 'Nashprep 5 mg 20 tablets', 'ناشبريب 5 مجم 20 قرص', 'Liver', 'أمراض الكبد', '- Medical Description: Tablets for the treatment of cholangitis.\r\n\r\n- Composition: Each tablet contains 5 mg of ursodeoxycholic acid.\r\n\r\n- Dosage: The usual dose is 5 mg daily for 3 months, and the dosage can be increased to 10 mg after 3 months or as directed by the physician.\r\n\r\n- Packaging: The package contains 20 tablets.', '- الوصف الطبي: أقراص لعلاج التهاب الأقنية الصفراوية.\r\n\r\n- التركيب: يحتوي كل قرص على 5 ملغ من حمض أورسوديوكسيكوليك.\r\n\r\n- الجرعة: الجرعة المعتادة هي 5 ملغ يومياً لمدة 3 أشهر، ويمكن زيادة الجرعة إلى 10 ملغ بعد 3 أشهر أو حسب توجيهات الطبيب.\r\n\r\n- العبوة: العبوة تحتوي على 20 قرص.', 144.00, 18, NULL, 'nashprep.jpg', '2024-05-23 15:09:44', '2024-06-24 10:37:51'),
(43, 'Bilino 15 gm 10 sachets', 'بيلينو 15 جم 10 كيس', 'Liver', 'أمراض الكبد', '- Medical Description: Sachets contain agar which may help get rid of bile in newborns.\r\n- Dosage: Dosage is determined by the treating physician.', '- الوصف الطبي: تحتوي الأكياس على الأجار الذي قد يساعد في التخلص من الصفراء عند الأطفال حديثي الولادة.\r\n- الجرعة: يتم تحديد الجرعة من قبل الطبيب المعالج.', 85.00, 29, NULL, 'bilino.jpg', '2024-05-28 08:18:16', '2024-05-28 08:18:16');
INSERT INTO `medicines` (`id`, `name`, `name_ar`, `category`, `category_ar`, `description`, `description_ar`, `price`, `stock`, `alternative_medicine_id`, `image_url`, `created_at`, `updated_at`) VALUES
(44, 'Pantoloc 40 mg 14 tablets', 'بانتولوك 40 مجم 14 قرص', 'Gastroenterology', 'الجهاز الهضمي', '- Medical Description: Tablets for treating acidity, gastric ulcers, and duodenal ulcers. \r\n\r\n- Composition: Each tablet contains 40 mg of Pantoprazole.\r\n\r\n- Usage:\r\n- Gastroesophageal reflux disease.\r\n- Gastric acidity.\r\n- Gastric and duodenal ulcers.\r\n- Used in the treatment of stomach bacteria\r\n\r\n- Dosage: The usual dose is one tablet before breakfast daily or as directed by the treating physician.', '- الوصف الطبي: أقراص لعلاج الحموضة وقرحة المعدة والاثني عشر.\r\n\r\n- التركيب: يحتوي كل قرص على 40 ملجم بانتوبرازول.\r\n\r\n- الاستخدام:\r\n- ارتجاع مَعدي مريئي.\r\n- حموضة المعدة.\r\n- قرحة المعدة والاثني عشر.\r\n- يستخدم في علاج جرثومة المعدة\r\n\r\n- الجرعة: الجرعة المعتادة هي قرص واحد قبل الإفطار يومياً أو حسب توجيهات الطبيب المعالج.', 68.50, 53, NULL, 'pantoloc.jpg', '2024-05-28 08:24:29', '2024-05-28 08:24:29'),
(45, 'Antinal 200 mg 24 Capsules', 'انتينال 200 مجم 24 كبسولة', 'Gastroenterology', 'الجهاز الهضمي', '- Medical Description: Capsules with an intestinal antiseptic effect, each containing 200 mg of Nitrofurazone.\r\n\r\n- Usage: Suspicion of acute diarrhea due to bacteria.\r\n\r\n- Dosage: For adults: One capsule four times daily for no more than 7 days or as directed by the physician.', '- الوصف الطبي: كبسولات ذات تأثير مطهر للأمعاء، تحتوي كل منها على 200 ملغ من نيتروفورازون.\r\n\r\n- الاستعمال: اشتباه في حدوث إسهال حاد بسبب البكتيريا.\r\n\r\n- الجرعة: للبالغين: كبسولة واحدة أربع مرات يومياً لمدة لا تزيد عن 7 أيام أو حسب إرشادات الطبيب.', 36.00, 15, NULL, 'antinal.jpg', '2024-05-28 08:25:48', '2024-05-28 08:25:48'),
(46, 'Neocarbon 30 Capsule', 'نيوكاربون 30 كبسولة', 'Gastroenterology', 'الجهاز الهضمي', '- Medical Description: Capsules for relieving excess internal gas and indigestion.\r\n\r\n- Composition: Each capsule contains 145 mg of activated charcoal, 50 mg of anise extract, and 45 mg of peppermint extract.\r\n\r\n- Dosage: Take 3 capsules twice daily after meals.', '- الوصف الطبي: كبسولات للتخفيف من الغازات الداخلية الزائدة وعسر الهضم.\r\n\r\n- التركيب: تحتوي كل كبسولة على 145 ملجم من الفحم المنشط، 50 ملجم من خلاصة اليانسون، و 45 ملجم من خلاصة النعناع.\r\n\r\n- الجرعة: تناول 3 كبسولات مرتين يوميا بعد الأكل.', 165.00, 22, NULL, 'neocarbon.jpg', '2024-05-28 08:27:09', '2024-05-28 08:27:09'),
(47, 'Setronomet 8 mg 4 tablets', 'سترونوميت 4 مجم 4 قرص', 'Gastroenterology', 'الجهاز الهضمي', '- Medical Description: Tablet containing Ondansetron 4 mg.\r\n\r\n- Usage: Prevention of nausea and vomiting.\r\n\r\n- Dosage: Take one tablet once, or as directed by the doctor.', '- الوصف الطبي: قرص يحتوي على أوندانسيترون 4 ملغ.\r\n\r\n- الاستخدام: الوقاية من الغثيان والقيء.\r\n\r\n- الجرعة: قرص واحد مرة واحدة، أو حسب توجيهات الطبيب.', 52.00, 10, NULL, 'setronomet.jpg', '2024-05-28 08:28:40', '2024-05-28 08:28:40'),
(48, 'INCAN-D Advance 30 tablets', 'انكان دي ادفانس 30 قرص مغلف', 'Vitamins', 'فيتامين', '- Medical Description: INCAN-D Advance tablets contain Vitamin D3 with a concentration of 10,000 international units and Boron 3 mg.\r\n\r\n- Usage: Treatment of Vitamin D deficiency and support for bone health and immune system.\r\n\r\n- Dosage: Take one tablet daily or as prescribed by the doctor.', '- الوصف الطبي: تحتوي أقراص أنكان دي أدفانس على فيتامين د3 بتركيز 10000 وحدة دولية والبورون 3 مجم.\r\n\r\n- الاستخدام: علاج نقص فيتامين د ودعم صحة العظام والجهاز المناعي.\r\n\r\n- الجرعة: تناول قرص واحد يومياً أو حسب إرشادات الطبيب.', 99.00, 5, NULL, 'INCAN-D.jpg', '2024-05-28 08:30:53', '2024-05-28 08:30:53'),
(49, 'Centrum With Lutein 100 tablets', 'سنترم مع لوتين 100 قرص', 'Vitamins', 'فيتامين', '- Medical Description: A multivitamin dietary supplement specially designed to meet the nutritional needs of adults.\r\n\r\n- Usage: Contains 24 micronutrients designed to support heart health, brain function, and eye health.\r\n\r\n- Dosage: Take one tablet daily.\r\n\r\n- Active Ingredients: Contains a variety of vitamins and minerals, including 250 micrograms of Lutein.', '- الوصف الطبي: مكمل غذائي متعدد الفيتامينات مصمم خصيصًا لتلبية الاحتياجات الغذائية للبالغين.\r\n\r\n- الاستخدام: يحتوي على 24 من المغذيات الدقيقة المصممة لدعم صحة القلب ووظائف المخ وصحة العين.\r\n\r\n- الجرعة: تناول قرص واحد يومياً.\r\n\r\n- المكونات النشطة: يحتوي على مجموعة متنوعة من الفيتامينات والمعادن، بما في ذلك 250 ميكروجرام من اللوتين.', 680.00, 11, NULL, 'Centrum.jpg', '2024-05-28 08:32:38', '2025-05-15 03:21:16'),
(50, 'BIOTIN 5000 mcg 60 caps', 'بيوتين 5000 ميكرو 60 كبسولة', 'Vitamins', 'فيتامين', '- Medical Description: Capsules containing a high concentration of biotin to support hair, skin, and nail health.\r\n\r\n- Usage: Each capsule contains 5000 micrograms of biotin (Vitamin B7).\r\n\r\n- Dosage: Take one capsule daily.\r\n\r\n- Packaging: Contains 60 capsules.', '- الوصف الطبي: كبسولات تحتوي على نسبة عالية من البيوتين لدعم صحة الشعر والبشرة والأظافر.\r\n\r\n- الاستخدام: تحتوي كل كبسولة على 5000 ميكروجرام من البيوتين (فيتامين ب7).\r\n\r\n- الجرعة: تناول كبسولة واحدة يومياً.\r\n\r\n- العبوة: تحتوي على 60 كبسولة.', 250.00, 11, NULL, 'BIOTIN.jpg', '2024-05-28 08:34:48', '2024-05-28 08:34:48'),
(52, 'Vitacid C 1gm 12 effervescent tablets', 'فيتاسيد سي 1 جرام 12 قرص فوار', 'Vitamins', 'فيتامين', '- Medical Description: Tablets containing a high concentration of Vitamin C to support immunity and resistance to infection.\r\n\r\n- Composition: Each tablet contains 1000 mg of Vitamin C.\r\n\r\n- Dosage: Take one tablet daily or as directed by the treating physician.\r\n\r\n- Packaging: Contains 12 tablets.\r\n\r\n- Note: May be used to increase urine acidity in some cases of kidney stones.', '- الوصف الطبي: أقراص تحتوي على تركيز عالي من فيتامين سي لدعم المناعة ومقاومة العدوى.\r\n\r\n- التركيب: يحتوي كل قرص على 1000 ملجم فيتامين سي.\r\n\r\n- الجرعة: تناول قرص واحد يومياً أو حسب توجيهات الطبيب المعالج.\r\n\r\n- العبوة: تحتوي على 12 قرص.\r\n\r\n- ملاحظة: يمكن استخدامه لزيادة حموضة البول في بعض حالات حصوات الكلى.', 36.50, 15, NULL, 'Vitacid.jpg', '2024-05-30 09:11:27', '2024-05-30 09:11:27'),
(53, 'Amoxicillin', 'أموكسيسيلين', 'Heart', 'القلب', 'Description: Amoxicillin is a penicillin antibiotic that fights bacteria.', 'الوصف: أموكسيسيلين هو مضاد حيوي من البنسلين يحارب البكتيريا.', 10.00, -687, NULL, 'Amoxcalin.jpeg', '2024-06-23 23:11:41', '2024-12-03 17:47:22'),
(54, 'Ibuprofen', 'ايبوبروفين', 'Heart', 'القلب', 'Description: Ibuprofen is used to reduce fever and treat pain or inflammation.', 'الوصف: يستخدم ايبوبروفين لخفض الحمى وعلاج الألم أو الالتهاب.', 8.00, 0, 14, 'Ibuprofen.jpeg', '2024-06-23 23:17:02', '2024-06-23 23:17:02');
